import React from 'react';

export default function Button({ className, onClick, text, link, type, page }) {
  if (page) {
    return (
      <a href={link} className={className} target={page && '_blank'}>
        {text}
      </a>
    );
  }
  return (
    <button type={type} className={className} onClick={onClick}>
      {text}
    </button>
  );
}
